import React from 'react';
import {
  StyleSheet,
  Text,
  View,
  SafeAreaView,
  Button,
  ImageBackground,
} from 'react-native';

const WelcomeScreen = () => {
  return (
    <View style={{ backgroundColor: 'orange' }}>
      <ImageBackground
        source={{
          width: 300,
          height: 500,
          uri:
            'https://images.squarespace-cdn.com/content/v1/5d27435d57ff580001f9d409/1566333652578-U7MP4A2A2M7ZT4557XQ2/ke17ZwdGBToddI8pDm48kDHPSfPanjkWqhH6pl6g5ph7gQa3H78H3Y0txjaiv_0fDoOvxcdMmMKkDsyUqMSsMWxHk725yiiHCCLfrh8O1z4YTzHvnKhyp6Da-NYroOW3ZGjoBKy3azqku80C789l0mwONMR1ELp49Lyc52iWr5dNb1QJw9casjKdtTg1_-y4jz4ptJBmI9gQmbjSQnNGng/IMG_8570.jpg?format=2500w',
        }}
      >
        <Button title='Login' color='dodgerblue' />
      </ImageBackground>
    </View>
  );
};

const styles = StyleSheet.create({
    backgroundColor:"orange"
});

export default WelcomeScreen;
